import './Nav.css';

import { Link } from 'react-router-dom';






function Nav() {
    return(

        <>
        <div  className='nav-item my-3 w-28 '>
            <nav className="flex justify-center space-x-4">
                <Link href="/" passHref><a href="/" className="font-medium px-3 py-2 text-purple-700  hover:text-white rounded-full border  hover:bg-purple-500  hover:border-transparent focus:outline-none focus:ring-2 focus:ring-purple-600 focus:ring-offset-2">Home</a></Link>
               <Link href="/team" passHref> <a href="/team"className="font-medium px-3 py-2 text-purple-700  hover:text-white rounded-full border  hover:bg-purple-500  hover:border-transparent focus:outline-none focus:ring-2 focus:ring-purple-600 focus:ring-offset-2">Team</a></Link>
                <Link href="/projects" passHref><a href="/projects" className="font-medium px-3 py-2 text-purple-700  hover:text-white rounded-full border  hover:bg-purple-500  hover:border-transparent focus:outline-none focus:ring-2 focus:ring-purple-600 focus:ring-offset-2">Projects</a></Link>
                <Link href="/reports" passHref><a href="/reports" className="font-medium px-3 py-2 text-purple-700  hover:text-white rounded-full border  hover:bg-purple-500  hover:border-transparent focus:outline-none focus:ring-2 focus:ring-purple-600 focus:ring-offset-2"></a>Reports</Link>
            </nav>

            
        </div>


        
        </>
    );
}

export default Nav;
